(* ::Subsection:: *)
(*Numerically produce the NLO & NNLO short - distance coefficients  of arXiv: 2306.11538 at ten azimuthal angle:*)


(*  see the formula (10) in arXiv: 2306.11538
cint1:   \hat{c}_int^{(1)}
cint2:   \hat{c}_int^{(2)}
cnfr1:   \hat{c}_nfr^{(1)}
cnfr2:   \hat{c}_nfr^{(2)}
*)


alldata[[All,1]]//TableForm


(*structure of alldata[[1]]  -------
  {"t=-0.4*mc^2 or  cos theta=0.999",
  {
     {{NLO_int _bare,  NLO_int _counterterm},
     {NNLO_int _bare,  NNLO_int _tree _counterterm, NNLO_int _loop _counterterm}}
     ,
    {{NLO_nfr _bare,  NLO_nfr _counterterm},
     {NNLO_nfr _bare,  NNLO_nfr _tree _counterterm, NNLO_nfr _loop _counterterm,  NNLO_nfr _ 1loop*1loop}}
  }
      }   *)


(*
NLO_int _bare:   squared amplitude of tree * one loop (interference term)
NLO_int _counterterm:   squared amplitude of tree * tree counterterm (interference term)
NNLO_int _bare:   squared amplitude of tree * two loop (interference term);  it is a list with 253 elements, wich corresponds to the results of the 253 two loop Feynman diagrams
NNLO_int _tree _counterterm:  squared amplitude of tree * tree counterterm (at order-alphs^2) (interference term)
NNLO_int _loop _counterterm:  squared amplitude of tree * loop counterterm (interference term)
----------------------------------------------
NLO_nfr _bare:   squared amplitude of tree * one loop (non-fragmentation term)
NLO_nfr _counterterm:   squared amplitude of tree * tree counterterm (non-fragmentation term)
NNLO_nfr _bare:   squared amplitude of tree * two loop (non-fragmentation term);  it is a list with 253 elements, wich corresponds to the results of the 253 two loop Feynman diagrams ( diagram + diagram of interchanging the two J/psi ), respectively
NNLO_nfr _tree _counterterm:  squared amplitude of tree * tree counterterm (at order-alphs^2) (non-fragmentation term)
NNLO_nfr _loop _counterterm:  squared amplitude of tree * loop counterterm (non-fragmentation term)
NNLO_nfr _ 1loop*1loop: squared amplitude of 1loop * 1loop (non-fragmentation term)
*)


